import "./styles.css";
import { Route, Routes } from "react-router-dom";
import User from "./routes/User";

export default function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/user" element={<User/>}/>
      </Routes>

    </div>
  );
}
